import React from "react";
import ford from "./assets/ford.jpg";
const path = require("path");

const projectStyle = {
  display: "flex",
  flexDirection: "row",
};

const cardStyle = {
  display: "flex",
  margin: "40px",
  border: "10px solid #59C9A5",
  maxWidth: "500px",
  backgroundColor: "#3B2C35",
  color: "#59C9A5",
};

function Project() {
  return (
    <>
      <div style={projectStyle}>
        <a href="https://whispering-fortress-31426.herokuapp.com/">
          <div className="card" style={cardStyle}>
            <div className="card-header">Ford Finder</div>
            <img
              src={ford}
              className="card-img-top"
              alt="Ford Finder App"
            ></img>
          </div>
        </a>

        <div className="card" style={cardStyle}>
          <div className="card-header">Yoda Speak Quiz</div>
          <img src={ford} className="card-img-top" alt="Ford Finder App"></img>
        </div>
      </div>
    </>
  );
}

export default Project;
